import React, { useState } from 'react';
import Table from './Table';
import Charts from './Charts';

const App = () => {
  const [data, setData] = useState([]);

  const handleDataChange = (newData) => {
    setData(newData);
  };

  return (
    <div className="App">
      <h1 className="text-center text-3xl my-5">Dashboard</h1>
      <Table onDataChange={handleDataChange} />
      <Charts data={data} />
    </div>
  );
};

export default App;
